const App = () => {
  const claimId = 'example-claim-id';  // Example Claim ID for testing

  const handleClaimSubmission = (formData) => {
    console.log('Submitting claim...', formData);
    // Add blockchain submission logic here
  };

  return (
    <div>
      <h1>Blockchain-Based Medical Insurance Claim DApp</h1>
      <ClaimForm onSubmitClaim={handleClaimSubmission} />
      <ClaimStatus claimId={claimId} />
      <AdminPanel claimId={claimId} />
      <TransactionHistory claimId={claimId} />
    </div>
  );
};

export default App;
